import React from 'react';
import { Avatar, Input, Button } from '@momentum-ui/react';

class Landing extends React.Component {

    render() {
        return (
            <div className="grid">
                <div className="row large-offset-1">
                    <h1>Classroom Set Up</h1>
                    <p>For each class, we'll walk you through the set-up process. you'll need names and email addresses of students for the set-up process.</p>
                </div>
            </div>
        );
    }
}
export default Landing;
